package assainment;


public class DeliverBoy {
	
	private String DeliveryBoyName;
	private String DeliveryBoyID;
	private String DelivaryBoyContuct;
	private String DeliveryReport;
	private String DeliveryDate;
	private String DeliveryTime;
	private String DeliveryLocation;
	
	
	public DeliverBoy(String DeliveryBoyName,String DeliveryBoyID,String DelivaryBoyContuct,String DeliveryReport,String DeliveryDate,String DeliveryTime,String DeliveryLocation) {
		// TODO Auto-generated constructor stub
		
		this.DeliveryBoyName = DeliveryBoyName;
		this.DeliveryBoyID = DeliveryBoyID;
		this.DelivaryBoyContuct = DelivaryBoyContuct;
		this.DeliveryReport = DeliveryReport;
		this.DeliveryDate = DeliveryDate;
		this.DeliveryTime = DeliveryTime;
		this.DeliveryLocation = DeliveryLocation;
	}


	public String getDeliveryBoyName() {
		return DeliveryBoyName;
	}


	public void setDeliveryBoyName(String deliveryBoyName) {
		DeliveryBoyName = deliveryBoyName;
	}


	public String getDeliveryBoyID() {
		return DeliveryBoyID;
	}


	public void setDeliveryBoyID(String deliveryBoyID) {
		DeliveryBoyID = deliveryBoyID;
	}


	public String getDelivaryBoyContuct() {
		return DelivaryBoyContuct;
	}


	public void setDelivaryBoyContuct(String delivaryBoyContuct) {
		DelivaryBoyContuct = delivaryBoyContuct;
	}


	public String getDeliveryReport() {
		return DeliveryReport;
	}


	public void setDeliveryReport(String deliveryReport) {
		DeliveryReport = deliveryReport;
	}


	public String getDeliveryDate() {
		return DeliveryDate;
	}


	public void setDeliveryDate(String deliveryDate) {
		DeliveryDate = deliveryDate;
	}


	public String getDeliveryTime() {
		return DeliveryTime;
	}


	public void setDeliveryTime(String deliveryTime) {
		DeliveryTime = deliveryTime;
	}


	public String getDeliveryLocation() {
		return DeliveryLocation;
	}


	public void setDeliveryLocation(String deliveryLocation) {
		DeliveryLocation = deliveryLocation;
	}	
	
	
}
